import React from "react";
import Page1 from "./page1";
import Page2 from "./page2";
import './App.css';
import {
  BrowserRouter,
  Route,
  Switch
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Buttons/>
        <Routes>
          <Route path="/components/pages" element={<Page1 />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
